import React from 'react';


const HomeStats = (data) => {

    const instance = data.props.hls.pstsg;
    console.log('home stats')
    console.log(instance);

    const mapPlayer = instance.map((player)=>
        <tr key={player}>
            <td>{player.num}</td>
            <td>{player.ln}, {player.fn}</td>
            <td>{player.pos}</td>
            <td>{player.min}</td>
            <td>{player.status}</td>
        </tr>
    )

    return (
        <div>
            <thead>
                <th>#</th>
                <th>Name</th>
                <th>Position</th>
                <th>Minutes</th>
                <th>Status</th>
            </thead>
            <tbody>
                {mapPlayer}
            </tbody>
        </div>
    );
}

export default HomeStats;
